import axios from 'axios'

export function getAllMeetList(){
    const apiUrl = 'http://127.0.0.1:8000/api/apiOverview';
    let data;
    axios.get(apiUrl)
        .then(res => {
            data = res.data;
            //console.log(data)
            return(data);
        }
    );    
}
